-- ----------------------------
-- Table structure for st_stock_record
-- ----------------------------
DROP TABLE IF EXISTS `st_stock_record`;
CREATE TABLE `st_stock_record`  (
  `id` bigint UNSIGNED NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL COMMENT '日期',
  `market` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `symbol` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '股票代码',
  `code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '代码',
  `exchange` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '交易所',
  `type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '股票类型',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '' COMMENT '股票名称',
  `chg` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '涨跌额',
  `current` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '当前价',
  `current_year_percent` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '年初至今-涨跌幅',
  `percent` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '涨跌幅',
  `volume` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '成交量',
  `amount` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '成交额',
  `turnover_rate` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '换手率',
  `pe_ttm` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '市盈率(TTM)',
  `dividend_yield` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '股息率',
  `market_capital` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '总市值',
  `float_market_capital` decimal(20, 2) NOT NULL DEFAULT 0.00 COMMENT '流通市值',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `date`(`date`) USING BTREE,
  INDEX `symbol`(`symbol`) USING BTREE,
  INDEX `code`(`code`) USING BTREE,
  INDEX `exchange`(`exchange`) USING BTREE,
  INDEX `percent`(`percent`) USING BTREE,
  INDEX `current_year_percent`(`current_year_percent`) USING BTREE,
  INDEX `market_capital`(`market_capital`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 358814 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

